import React, { useCallback, useState } from "react";

import "./App.css";
import Button from "./components/UI/Button/Button";
import Text from "./components/UI/Button/Text";
function App() {
  const [flag, updateFlag] = useState(false);
  const changeFlag = useCallback(() => {
    updateFlag(!flag);
  }, [flag]);
  console.log("APP");
  return (
    <div className="app">
      <h1>This is Muhib Here</h1>
      <Text show={flag} />
      <Button onClick={changeFlag}>Update here</Button>
    </div>
  );
}

export default App;
